class CharTree:
    def __init__(self, prev='None', val='', depth=1):
        self.prev = prev
        self.next = {}
        self.val = val
        self.depth = depth

class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        str_tree = {}
        str_ptr = {}
        max_depth = len(set(s))
        cur_depth = 0
        
        for c in s:
            for k, v in str_ptr.items():
                if v is None: continue
                ptr = v
                is_found = False
                # print('k=', k, ' v=', v.val)

                # traverse back to find this char
                while ptr is not None:
                    # print('  ptr.val=', ptr.val, ' c=',c)
                    if ptr.val == c:
                        is_found = True
                        # if found, remove from str_ptr
                        str_ptr[k] = None
                        break

                    ptr = ptr.prev
  
                if not is_found:
                    # assign to next
                    ptr = str_ptr[k]
                    # print('-> add',c,'to',ptr.val)
                    ptr.next[c] = CharTree(ptr, c, ptr.depth + 1)
                    str_ptr[k] = ptr.next[c]
                    if (ptr.depth + 1 > cur_depth):
                        cur_depth = ptr.depth + 1
                        if cur_depth == max_depth:
                            return max_depth

            # init root char if c not found in tree
            if c not in str_tree:
                # prev = None is head
                str_tree[c] = CharTree(None, c, 1)
                if (1 > cur_depth):
                    cur_depth = 1
                str_ptr[c] = str_tree[c]
            
            # reassign to ptr, if c match root char
            if c in str_ptr and str_ptr[c] is None and c in str_tree:
                str_ptr[c] = str_tree[c]

        return cur_depth

        # # print tree
        # for k,v in str_tree.items():
        #     print_dict(v, 0)
        # return cur_depth

def print_dict(ct, space_count):
    print(' '*space_count, end='')
    print(ct.val, end='\n')
    for k,v in ct.next.items():
        print_dict(v, space_count + 2)

